<!--(1PSRU)stroybrus.ru--><li>ИЗ ЧЕГО СТРОИТЬ ДОМ?
Из чего нужно строить дом? Можно построить деревянный дом - из бревна, клееного или циллиндрованного бруса, а можно - из кирпича или пенобетона. Дома из экобруса легко и быстро собираются из отдельных элементов по любому проекту. Благодаря конструкции бруса "гребень - паз" дом монтируется по принципу детского конструктора. Дом размером 6м х 6м собирается за 5 часов. Монтаж достаточно прост:
гребень бруса смазивается раствором, состоящим из смеси бишофита и магнезита, и брусья соединяются. Возможно применение цементного раствора. После схватывания мест стыковки конструкция достигает прочности монолитного бетона. Боковая поверхность бруса такова, что он не требует штукатурных работ.  <a href="http://www.stroybrus.ru">строительство коттеджей подмосковье</a> поможет вам в этом! Огромная
коллекция сайтов строительной тематики. Деревянный дом - это комфорт и экологичность. Однако дерево со временем приходит в негодность под действием окружающей среды и требует ухода, а главное - дерево подвержено горению. При оцилиндровке древесины 30-40% бревна теряет защитные свойства и быстро подвергается разрушению. Бревно получает продольные трещины, которые необходимо конопатить. Если
нарушена заготовка древесины, то бревно прослужит на 20-25% меньше.
Дома из кирпича или бетонных блоков, прочные и долговечные, имеют свои недостатки: очень высокая стоимость материалов и работ, а также эффект "цементной клетки" из-за присутствия ж/б изделий и цементных растворов. При попадании в бетонный блок влаги во время минусовой температуры происходит его разрушение. А так же, если вас интересуют сайты не строительной тематики а компьютеры и у вас не
работает компьютер то <a href="http://www.seeo.ru ">обслуживание компьютеров в москве</a> это то, что вам нужно. Прессованный брус согласно техническому свидетельству Гос. Комитета России № ТС07.0128-98 и гигиенического сертификата Гос. Комитета санитарно-эпидемиологического надзора РФ предназначен для строительства зданий и сооружений различного назначения.
Дома из бишофитового бруса легко и быстро собираются из отдельных элементов по любому проекту благодаря конструкции бруса "гребень - паз" монтируется по принципу детского конструктора (дом 6х6 собирается за 5 часов). Монтаж достаточно прост и не требует высокооплачиваемого специалиста: гребень бруса промазывается раствором бишофита и магнезита, и соединяются (возможно применение цементного
раствора) . После схватывания мест стыковки конструкция достигает прочности монолитного блока. Гладкая боковая поверхность бруса такова, что не требует штукатурных работ.<br> 
